import { React, useState } from "react";
import { Form, Button } from 'react-bootstrap';
import emailjs from 'emailjs-com';

const Contact = () => {
  // const [name, setName] = useState('')
  // const [subject, setSubject] = useState('')
  // const [email, setEmail] = useState('')
  // const [message, setMessage] = useState('')

  const handleSubmit = (e) => {
    e.preventDefault();
    emailjs.sendForm(process.env.REACT_APP_SERVICE_ID, process.env.REACT_APP_TEMPLATE_ID, e.target, process.env.REACT_APP_USER_ID)
      .then((result) => {
        console.log(result.text);
      }, (error) => {
        console.log(error.text);
      });
  }

  return (
    <div className='contact-page'>
      <br/>
      <h1>Contact Me!</h1>

      <div className='contact-container'>
        <Form onSubmit={e => handleSubmit(e)}>
          <Form.Group controlId="formGroupName" className='contact-name' onChange={e => setName(e.target.value)} required>
            <Form.Label>Name</Form.Label>
            <Form.Control type="name"/>
          </Form.Group>
          <Form.Group controlId="formGroupEmail" className='contact-email'>
            <Form.Label>Email</Form.Label>
            <Form.Control type="email" onChange={e => setEmail(e.target.value)} required/>
          </Form.Group>
          <Form.Group controlId="formGroupSubject" className='contact-subject'>
            <Form.Label>Subject</Form.Label>
            <Form.Control type="subject" onChange={e => setSubject(e.target.value)} required/>
          </Form.Group>
          <Form.Group controlId="formGroupMessage" className='contact-message'>
            <Form.Label>Message</Form.Label>
            <Form.Control as='textarea' onChange={e => setMessage(e.target.value)} required/>
          </Form.Group>
          <Button type='submit' variant="dark" className='contact-btn'>Send</Button>
        </Form>
      </div>
    </div>
  )
}

export default Contact;
